import React,  { Component } from 'react';
import { connect } from 'react-redux';
import { startTest } from '../store';
import Button from '@material-ui/core/Button';
import { PieChart } from 'react-minimal-pie-chart';


class Start extends Component {
  constructor(props) {
    super(props);
    qnumber:0;
    this.doStart = this.doStart.bind(this);
  }

  doStart(e){
    let action = startTest();
    this.props.dispatch(action);
  }

  render(){
    return(
      <div>
        <ul className="list-wrap">
          <li className="list-circle list-circle1"><span>正解</span></li>
          <li className="list-circle list-circle2"><span>不正解</span></li>
          <li className="list-circle list-circle3"><span>未学習</span></li>
        </ul>
        {/* <span><div className="circle"></div></span> */}
        <div className="circledata">
          <PieChart  startAngle= {270} data ={[
            { title: '正解', value: 10, color: '#C13C37' },
            { title: '不正解', value: 15, color: 'blue' },
            { title: '未学習', value: 20, color: 'grey' },
          ]}
          label={({ dataEntry }) => `${Math.round(dataEntry.percentage)} %`}
          animate ={true}
          animationDuration ={400}
          />
        </div>
        <div>
          <Button variant="contained" color="primary" onClick={this.doStart}>
            10問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="secondary" onClick={this.doStart}>
            30問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="primary" onClick={this.doStart}>
            50問Start
          </Button> 
        </div>
        <div>
          <Button variant="contained" color="secondary" onClick={this.doStart}>
            50問Start
          </Button> 
        </div>
      </div>
    );
  }
}

Start = connect((state) => state)(Start);
export default Start;
